    April Quarterly Report (1/1/12-3/31/12)    To Whom It May Concern:    We are in
    receipt of the letter from the Commission regarding the above referenced report.
    \ Please see below for our complete response.    The apparently excessive contributions
    in question were presumptively redesignated from the primary election to the general
    election.  We sent the contributors the required letters notifying them of the
    redesignation and offering them a refund within the 60 day window allowed.  However,
    we failed to understand how that redesignation had to appear on the report.  We
    regret this error occurred and have since conducted an extensive internal review
    to identify and correct any other omissions such as this.  We are now filing an
    amendment on this report, among others, with the Commission to reflect this change.
    \  The requests for additional information made by the Commission will also be
    addressed in these filings.    Thank you for the opportunity to respond.  Please
    contact us if you need any additional information.    Sincerely,    Rob Zerban
    for Congress  \n"
